import React from 'react'
import RadioComponent from './RadioComponent'
import moviesList from './src/data.js'

const SelectMovie = () => {
  return (
    <div>
        {moviesList.map((el, index) => {
            return (
                <RadioComponent text={el} key={index} />
            )
        })}
    </div>
  )
}

export default SelectMovie
